import React, { useEffect, useState } from "react";
import axios from "axios";
import { userBooking } from "../actions/BookingAction";

function PrintScreen(props) {
  const [userbookings, setUserbooking] = useState([]);

  const fetchdata = axios
    .get(`http://localhost:5000/api/booking/bookinglist`)
    // .then((response) => response.json())
    // .then((data) => setData(data))
    .then((res) => {
      console.log(userbookings);
      setUserbooking(res.data);
    })
    .catch((err) => {
      console.log(err);
    });
  useEffect(() => {
    fetchdata();
  }, [fetchdata]);

  return (
    <div>
      <h1>Thank You for registering</h1>
      <p>PLease don't forget to carry your photo id and print out copy </p>
      <button>Print Copy</button>

      <ul>
        {userbookings.map((userbooking, id) => (
          <li key={userBooking._id}>
            <h1>{userbooking.id}</h1>
            <h1>{userbooking.hoslocation}</h1>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default PrintScreen;
